import React from 'react'

const Color = (props) => {

    const styles = {
        backgroundColor: props.background}
    return (
        <div style={styles}>
            <h1>Color Box Component</h1>
            <p>This is color box number {props.number} </p>
            <img src={props.pic} />
        </div>
    )
}

export default Color
